import React, { useState } from "react";


const Index = ()=>{
    const [count,setCount] =useState(0)
    const increment = ()=>{
        setCount(count+1)
    }
    const decrement = ()=>{
        setCount(count-1)
    }
    const reset= ()=>{
        setCount(0)
    }
    return (
        <>
            <h1>Counter== {count}</h1>
            <div>
                <button onClick={increment}>increment</button>
                <button onClick={decrement}>decrement</button>
                <button onClick={reset}>reset</button>
            </div>

        </>
    )
}
export default Index;
